import React, { Component } from "react";
import Link from "next/link";

class Detail extends Component{
    render(){
        const{title1 = "AOWSAY", img = "/static/images/products/1.png", imgtype={}} = this.props;
        return(              
                <div className="col-lg-3 col-md-3 col-sm-3 ml-3 mr-3 shadow-sm mb-5 pt-3 bg-dark rounded">
                <Link href={'/blog/theresume'}><a>                    
                    <img src={img} className="img-fluid" />
                    <hr/>                          
                </a></Link>
                <h3 className="text-center">{title1}</h3>
                <img className="text-right" src={imgtype} style={{width:20}} className="img-fluid" />
                <hr/>
            </div>                     
        )
    }
}

export default Detail;
